import React from "react";
import "../products/Products.css";
import { useDispatch } from "react-redux";

function Products({id, name, cost, quantity, url}) {

  const dispatch = useDispatch();

  const addProduct = () => {
    const obj = {
      id,
      name,
      url,
      cost,
    };
    onClickAddProduct({ ...obj });
    dispatch({
      type: "ADD_PRODUCT_CART",
      payload: obj,
    });
  };

  return (
    <div>
      <div className="row">
        <div className="product">
          <div className="card-body">
            <div className="immg">
              <img
                className="img"
                src={url}
                alt="Product img"
              ></img>
            </div>
            <h5>{name}</h5>
          </div>
          <div className="price">
            <h3>{cost}</h3>
          </div>
          <button className="basket_btn">Добавить в корзину</button>
        </div>

      </div>
    </div>
  );
}

export default Products;
